import React from 'react';
import { Link } from 'react-router-dom';
import Button from '@material-ui/core/Button';
// import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Fade from '@mui/material/Fade';
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';
import 'antd/dist/antd.css';
import { Menu } from 'antd';
import { MailOutlined, AppstoreOutlined, SettingOutlined } from '@ant-design/icons';
import { useState } from "react";
const AppBar = () => {
	// const { current } = this.state;
	const [current, setCurrent] = useState();
	const [anchorEl, setAnchorEl] = React.useState(null);
	const open = Boolean(anchorEl);
	// const handleClick = (event) => {
	// 	setAnchorEl(event.currentTarget);
	// };
	const handleClick = (e) => {
		console.log('click ', e);
		setCurrent(e.key);
	};
	const handleClose = () => {
		setAnchorEl(null);
	};
	const { SubMenu } = Menu;
	return (
		<div className="App">
			<section id="header">
				<div class="header container">
					<div class="nav-bar">
						<div class="brand">
							<div id="drawing">
								<div className="circle"></div>
							</div>
							<a href="#hero">
								<h1><span>NEMO</span> NTU</h1>
							</a>

							{/* <img src="https://i.ibb.co/Vwf0DbB/Logo.jpg" border="0"/> */}
						</div>
						<Menu onClick={handleClick} selectedKeys={[current]} mode="verticle" >
							<SubMenu key="SubMenu" icon={<SettingOutlined />} title="Navigation Three - Submenu">
								<Menu.ItemGroup title="Item 1">
									<Menu.Item key="setting:1">Option 1</Menu.Item>
									<Menu.Item key="setting:2">Option 2</Menu.Item>
								</Menu.ItemGroup>
								<Menu.ItemGroup title="Item 2">
									<Menu.Item key="setting:3">Option 3</Menu.Item>
									<Menu.Item key="setting:4">Option 4</Menu.Item>
								</Menu.ItemGroup>
							</SubMenu>
							{/* <Menu.Item key="alipay">
											<a href="https://ant.design" target="_blank" rel="noopener noreferrer">
												Navigation Four - Link
											</a>
										</Menu.Item> */}
						</Menu>
						<div class="nav-list">
							<div class="hamburger">
								<div class="bar"></div>
							</div>
							<ul>
								<li><a href="#hero" data-after="Home"><Link to="/main">Home</Link></a></li>
								<li><a href="#services" data-after="Service">Intro</a></li>
								<li><a href="#projects" data-after="Projects">Publication</a></li>
								<li><a href="#about" data-after="About">Member</a></li>
								<li><a href="#contact" data-after="Contact">Contact</a></li>
							</ul>
						</div>
					</div>
				</div>
			</section>
		</div>
	)
}
export default AppBar;
